import React, { useEffect, useState } from 'react';

const Doggie = () => {
    const url = "https://dog-api.kinduff.com/api/facts?number=3";
    const [dogs, setDogs] = useState([]);
    useEffect(() => {
        fetch(url).then((response) => response.json()).then(resJson => { setDogs(resJson.facts)})
            .catch((err) => console.log('error'));
    }, [])
    return (
        <>
            <div>
      <h2>Dogs:</h2>
      <ul>
        {dogs.map(dog => (
          <li key={dog._id}>
            <h3>{dog.breed}</h3>
            <p>Lifetime: {dog.lifetime}</p>
            <p>Food: {dog.food}</p>
          </li>
        ))}
      </ul>
    </div>
        </>
    );
}

export default Doggie;
